import { BleManager } from 'react-native-ble-plx';

export const manager = new BleManager();

function BluTest({navigation}){
    useEffect(() => {
        console.log(manager)
    }, []);
    return(
        <View style={{}}> 
            <Text>Bluetooth Teste</Text>
        </View>
  )
}



export default BluTest
